import React, {useEffect, useState} from "react";

import './css/Education.css'
import { BiCodeCurly, BiBookOpen, BiLike } from "react-icons/bi";

import Loader from './Loader';
import Calls from "./Calls";

export default function Education() {

  const [data, setData] = useState({});
  const [loading, setLoading] = useState(true);

    useEffect(() => {
      fetch(Calls.getCommandUri() + '/cv/education')
        .then(response => {
          if (response.ok) {
            return response.json();
          }
          throw response;
        })
        .then(data => {
          setData(data);
          setLoading(false);
        })
        .catch(error => {
          console.error("Error fetching data: ", error);
          setLoading(false);
        })
    }, [])

  const iconsColor = '#49a572';
  const iconsSize = '30px';


  return (
    <div className='Section'>
      <div>
        <strong className="Titles MainTitle">Vzdělání </strong>
      </div>
      <div>
        <p className="Paragraf">
        {loading ? <Loader /> : data.edu_p1 }
        </p>
        <p className="Paragraf">
        {loading ? <Loader /> : data.edu_p2 }
        </p>
        <p className="Paragraf">
        {loading ? <Loader /> : data.edu_p3 }
        </p>
        <div className="Interested-Container">
          <div className="Interested-Section">
            <div className="Interested-Item">
              <div className="Interested-Title">
                Znalosti
              </div>
              <div className="Interested-Item-Icon" title="Znalosti">
                <BiBookOpen color={iconsColor} size={iconsSize}/>
              </div>
              <div className="Interested-Item-Border">
                <div className="Interested-Item-Content">
                  {loading ? <Loader /> : data.znalosti.map((item) => (
                    <div>{item}</div>
                  ))}
                </div>
              </div>
            </div>
          </div>
          <div className="Interested-Section">
            <div className="Interested-Item">
              <div className="Interested-Title">
                Jazyky
              </div>
              <div className="Interested-Item-Icon" title="Jazyky">
                <BiCodeCurly color={iconsColor} size={iconsSize}/>
              </div>
              <div className="Interested-Item-Border">
                <div className="Interested-Item-Content">
                  {loading ? <Loader /> : data.jazyky.map((item) => (
                    <div>{item}</div>
                  ))}
                </div>
              </div>
            </div>
          </div>
          <div className="Interested-Section">
            <div className="Interested-Item">
              <div className="Interested-Title">
                Zájem o
              </div>
              <div className="Interested-Item-Icon" title="Zájem o">
                <BiLike color={iconsColor} size={iconsSize}/>
              </div>
              <div className="Interested-Item-Border">
                <div className="Interested-Item-Content">
                  {loading ? <Loader /> : data.zajem.map((item) => (
                    <div>{item}</div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div>
        <div>
          <strong className="Titles SecondTitle">Zaměstnání</strong>
        </div>
        <p className="Paragraf">
        {loading ? <Loader /> : data.zam.map((item) => (
          <ul>
            <li> {item.firmaPozice} <strong className="Highligh-Green-Text">/</strong> {item.prace} <strong className="Highligh-Green-Text">/</strong> {item.pusobeni} </li>
          </ul>
        ))}
        </p>
      </div>
    </div>
  );
}
